INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.4, "お！\nあそこに困ってそうな人発見！", 0, 1001, "春咲 ひより", 1, 0, 0, 0, 1, 2, 1, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", "ヒヨリでっす♪\n元気いっぱいがんばるよ♪");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.4, "大切な人を\n守れるようになりたい…って", 0, 1002, "草野 優衣", 1, 0, 0, 0, 1, 2, 1, 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", "みんなみたいに\nわたしも強くならなきゃ");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.4, "キミに必要な集中力と感性が", 0, 1003, "士条 怜", 1, 0, 0, 0, 1, 2, 1, 0, "少しは磨かれると思いますよ。", "フェンシングを始めてみては？");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.5, "今日はなにして遊ぶ？", 0, 1004, "穂高 みそぎ", 1, 0, 0, 0, 1, 2, 1, 0, "みそぎはねぇ、\nかくれんぼやりたい！", "ねぇ、にいちゃん！");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.4, "ねぇ…", 0, 1006, "風宮 あかり", 1, 0, 0, 0, 1, 2, 1, 0, "私といっしょに…\nいかない？", "風宮あかりです");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.5, "プリンたべたいのー", 0, 1007, "出雲 宮子", 1, 0, 0, 0, 1, 2, 1, 0, "食べ物の恨みは怖いのー", "出雲宮子なのー");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.4, "キミもボクの美貌に\n吸い寄せられたんだね。", 0, 1008, "虹村 雪", 1, 0, 0, 0, 1, 2, 1, 0, "いいよ。\n見られることは運命さ…", "ボクは虹村雪。");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.4, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0, 1009, "柊杏奈", 1, 0, 0, 0, 1, 2, 1, 0, "人呼んで「疾風の冥姫」!!", "フッ…聞いて後悔するがいい！");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.5, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0, 1010, "姫宮 真歩", 1, 0, 0, 0, 1, 2, 1, 0, "ほんまおおきにやわ～♪", "マホマホ王国のプリンセス、\nまほ姫どす");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.4, "生き別れたお兄ちゃんを探して\n三千世界！", 0, 1011, "衣之咲 璃乃", 1, 0, 0, 0, 1, 2, 1, 0, "ここで会ったが\n100年目～！", "衣之咲璃乃です！");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.4, "ち、超能力って…\n何のことかな～？", 0, 1012, "柏崎 初音", 1, 0, 0, 0, 1, 2, 1, 0, "…って、お願い！\n誰にも言わないでおいて～！", "私はハツネ、\n結構強いんだよ。\nきらーん☆");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.4, "一応カリスマ読モJKやってまっす！", 0, 1016, "美波 鈴奈", 1, 0, 0, 0, 1, 2, 1, 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", "ちょす！\n美波鈴奈だよ～♪");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.4, "東京は遊園地みたいなところさー", 0, 1017, "喜屋武 香織", 1, 0, 0, 0, 1, 2, 1, 0, "でも、沖縄もとってもいいとこさー", "はいたーい。\n喜屋武香織さー。");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.4, "先生って呼ばれるのは\nくすぐったいから", 0, 1018, "支倉 伊緒", 1, 0, 0, 0, 1, 2, 1, 0, "イオちゃんって呼んでね。", "支倉伊緒です。");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.5, "あ！/\お兄ちゃ～ん\nまってよ～", 0, 1020, "茜 ミミ", 1, 0, 0, 0, 1, 2, 1, 0, "ミミをおいてかないでぇ～", "ふえ…？\nミミ、むずかしいこと\nよくわかんない…");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.5, "あの……\nふぇ……", 0, 1021, "栗林 くるみ", 1, 0, 0, 0, 1, 2, 1, 0, "ふぇぇぇぇぇん……", "あ…あの…えっと…\n栗…林…くるみ…です……");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.4, "こんな私に貴重な時間を\n割いていただき、", 0, 1022, "風宮 より", 1, 0, 0, 0, 1, 2, 1, 0, "なんてありがとうございます！", "風宮よりです。\nあああああ！");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.5, "おにいちゃんどこいくの？\nえ？", 0, 1023, "北条 綾音", 1, 0, 0, 0, 1, 2, 1, 0, "私こっち行きたいー\nね、早く早くー", "私、アヤネ！\nぷうきちと一緒についてってあげるね！");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.4, "ふ、不束者ですが\nどうぞ末永く…って、", 0, 1025, "天野 すずめ", 1, 0, 0, 0, 1, 2, 1, 0, "これて何か違う…\nあああすみません！", "わっ…わっ…私、\n天野すずめといいます！");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.4, "あなたは…運命の……\n伴侶……", 0, 1027, "倉石 恵理子", 1, 0, 0, 0, 1, 2, 1, 0, "離しませんわ………\n絶対に…!!", "……クスクス…私は\n…倉石恵理子……");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.4, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0, 1028, "佐々木 咲恋", 1, 0, 0, 0, 1, 2, 1, 0, "…そうでしょ？？", "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.4, "ぇっと…\nキミ、私のこと知らないの?!", 0, 1029, "桜井 望", 1, 0, 0, 0, 1, 2, 1, 0, "あはは、\n私もまだまだだなぁ～", "桜井望だよ！\nよろしくねっ");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.4, "初めまして、\n私はニノン・ジュベール申すデス！", 0, 1030, "ニノン・ジュベール", 1, 0, 0, 0, 1, 2, 1, 0, "ショーグン、\nワタシと一緒に天下統一デース！", "デケデケデンっ！");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.4, "でもって私の隣にいるのが……\nえ、見えない？", 0, 1031, "上喜 しのぶ", 1, 0, 0, 0, 1, 2, 1, 0, "おかしいですね……", "上喜しのぶです。\n手元のドクロが父です。");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.5, "けんども\nそれには足りないモンが…", 0, 1033, "野戸まひる", 1, 0, 0, 0, 1, 2, 1, 0, "そう、\nオラのボケに突っ込める相方が…！", "目指すはビッグな\nお笑い芸人だっぺ！");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.4, "ちょっと緊張しちゃって…", 0, 1034, "綾瀬 ゆかり", 1, 0, 0, 0, 1, 2, 1, 0, "ちょ\nちょっと一杯飲んできます…！", "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.5, "知らない人とは話しちゃいけないので", 0, 1036, "氷川 鏡華", 1, 0, 0, 0, 1, 2, 1, 0, "これ以上お話しすることは…\nないです！", "氷川鏡華…です");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.4, "……あ、アラーム。", 0, 1038, "柏崎 栞", 1, 0, 0, 0, 1, 2, 1, 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", "柏崎…栞です。");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.4, "私、一人も友達がいなくて……", 0, 1040, "双葉 碧", 1, 0, 0, 0, 1, 2, 1, 0, "野に咲く花が、\n唯一の話相手です。", "ふ、双葉碧です。");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.4, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0, 1042, "三角 千歌", 1, 0, 0, 0, 1, 2, 1, 0, "そう思っています。", "三角千歌です。");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.4, "あぁ？\nお前のそいつの仲間か？", 0, 1043, "安芸 真琴", 1, 0, 0, 0, 1, 2, 1, 0, "う、疑ってすまなかったな…", "安芸真琴だ。");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.4, "生けとし生ける全ての者よ！", 0, 1044, "イリヤ・オーンスタイン", 1, 0, 0, 0, 1, 2, 1, 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", "わらわこそは夜を総べる者！");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.4, "ぐふふふふ……はっ！", 0, 1045, "遠見 空花", 1, 0, 0, 0, 1, 2, 1, 0, "ｌク、クウカに何かご用ですか!?", "そこで騎士は妖精を乱暴に……");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.4, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0, 1046, "宮坂たまき", 1, 0, 0, 0, 1, 2, 1, 0, "う～ん…\n猫ってホントに最高にゃ～♪", "宮坂たまきにゃ♪\n猫はいいにゃよ？");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.4, "それでは早速クエストに…", 0, 1048, "大神 美冬", 1, 0, 0, 0, 1, 2, 1, 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", "大神美冬よ！");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.4, "クエストもバトルも\n掃除も洗濯も", 0, 1049, "星野静流", 1, 0, 0, 0, 1, 2, 1, 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", "星野静流だよ！");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.5, "見ての通りの\nセクシー美少女で", 0, 1050, "玉泉美咲", 1, 0, 0, 0, 1, 2, 1, 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", "アタシは玉泉美咲。");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.4, "？？？？", 0, 1052, "リマ", 1, 0, 0, 0, 1, 2, 1, 0, "？？？？", "？？？");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.5, "菓子でつろうなどと\n稚拙な策を……", 0, 1053, "モニカ・ヴァイスヴィント", 1, 0, 0, 0, 1, 2, 1, 0, "そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィントだ。");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.5, "菓子でつろうなどと\n稚拙な策を……", 0, 1058, "ペコリーヌ", 1, 0, 0, 0, 1, 2, 1, 0, "そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィントだ。");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.5, "菓子でつろうなどと\n稚拙な策を……", 0, 1059, "コッコロ", 1, 0, 0, 0, 1, 2, 1, 0, "そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィントだ。");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1.5, "菓子でつろうなどと\n稚拙な策を……", 0, 1060, "キャル", 1, 0, 0, 0, 1, 2, 1, 0, "そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィントだ。");
